    .wrap{position:relative; z-index:2; display:flex; flex-direction:column; align-items:center; gap:.6rem; padding: clamp(1rem, 2.5vw, 2rem)}
    .title{font-family:'Cinzel',serif; font-weight:900; text-align:center; font-size: clamp(1.4rem, 4.8vw, 2.6rem); letter-spacing:.06em; text-shadow:0 6px 28px rgba(0,0,0,.65)}
    .timer{display:flex; gap:.5rem; margin-top:.35rem; flex-wrap:wrap; justify-content:center}
    .tbox{min-width: clamp(56px, 9vw, 96px); padding:.42rem .55rem; border-radius:14px; background: rgba(0,0,0,.50); border:1px solid rgba(255,255,255,.16); backdrop-filter: blur(4px); box-shadow: 0 6px 18px rgba(0,0,0,.45)}
    .num{font-variant-numeric: tabular-nums; font-weight:800; font-size: clamp(1rem, 3.4vw, 1.3rem); line-height:1}
    .lbl{margin-top:.06rem; font-size:.64rem; letter-spacing:.18em; text-transform:uppercase; color:#cfd8ea; opacity:.85}
    .footer{margin-top:.2rem; color:#c3d4ff99; font-size:.85rem; text-align:center}
    .signature{position:absolute; bottom:2.4vh; width:100%; text-align:center; font-family:'Great Vibes',cursive; font-size: clamp(1.6rem,6vw,2.8rem); color:var(--gold); text-shadow:0 2px 14px rgba(0,0,0,.55)}
    @media (prefers-reduced-motion: reduce){ *{animation:none} }
  </style>
</head>
<body>
  <main class="hero" role="img" aria-label="A colossal, realistic steampunk dwarven city-ship without sails, smokestacks churning, sailing into deep eerie mists under pale moonlight across a dark ocean">
    <div class="wrap" role="region" aria-live="polite">
      <h1 class="title">Khaz Modan Expedition</h1>
      <div class="timer" id="timer" aria-label="Countdown timer to November 1, 2025, 5:30 PM Pacific"></div>
      <div class="footer" id="status"></div>
      <div class="signature" aria-hidden="true">The Mists Await</div>
    </div>
  </main>

  <script>
    // Target: Nov 1, 2025 5:30 PM Pacific (DST still active → UTC-7)
    const target = new Date('2025-11-01T17:30:00-07:00');

    const parts = [ ['days','Days'], ['hours','Hours'], ['minutes','Minutes'], ['seconds','Seconds'] ];
    const timerEl = document.getElementById('timer');
    const statusEl = document.getElementById('status');

    const boxes = {};
    for(const [key,label] of parts){
      const box = document.createElement('div'); box.className='tbox';
      box.innerHTML = `<div class="num" id="num-${key}">00</div><div class="lbl">${label}</div>`;
      timerEl.appendChild(box); boxes[key] = box.querySelector('.num');
    }

    const pad = n => String(n).padStart(2,'0');
    function tick(){
      const now = new Date();
      const ms = Math.max(0, target - now);
      const s = Math.floor(ms/1000);
      const d = Math.floor(s/86400);
      const h = Math.floor((s%86400)/3600);
      const m = Math.floor((s%3600)/60);
      const sec = s%60;

      boxes.days.textContent = d;
      boxes.hours.textContent = pad(h);
      boxes.minutes.textContent = pad(m);
      boxes.seconds.textContent = pad(sec);

      if(ms===0){
        statusEl.textContent = '🛟 Lines cast! The city‑ship breaches the mists.';
        clearInterval(loop);
      } else { statusEl.textContent = ''; }
    }
    const loop = setInterval(tick, 1000); tick();
  </script>
</body>
</html>
